import React from 'react';
import {SafeAreaView, Text, Image} from 'react-native';
import CurrencyConverter from './CurrencyConverter';

const App = () => {
  return (
    <SafeAreaView style = {styles.container}>
      <Image source={require("./assets/dollar_golden.png")} />
      <Text>MADS Lab Test 2 Exhchange Calculator</Text>
      <CurrencyConverter/>
    </SafeAreaView>
  );

  const styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 24,
      backgroundColor: "#eaeaea"
    },
    title: {
      marginTop: 16,
      paddingVertical: 8,
      borderWidth: 4,
      borderColor: "#20232a",
      borderRadius: 6,
      backgroundColor: "#61dafb",
      color: "#20232a",
      textAlign: "center",
      fontSize: 30,
      fontWeight: "bold"
    }
  });
}

export default App;
